import React from 'react'
import styles from './Tags.module.scss'

export default function Tags({tags}) {
  return (
    <div className={styles.tags}>
        <p className={styles.tags__p}>Filtre por tags:</p>
        <ul className={styles.tags__lista}>
          {tags.map((tag) => {
            <li key={tag}>
              {tag}
            </li>
          })}
        </ul>
    </div>
  )
}
